package it.cnr.ilc.ga.model.analysis;

public class Form {

	private String value;
	private String normalizedValue;
	private String extendedValue;
	
	public Form() {
		// TODO Auto-generated constructor stub
	}

	/**
	 * @return the value
	 */
	public String getValue() {
		return value;
	}

	/**
	 * @param value the value to set
	 */
	public void setValue(String value) {
		this.value = value;
	}

	/**
	 * @return the normalizedValue
	 */
	public String getNormalizedValue() {
		return normalizedValue;
	}

	/**
	 * @param normalizedValue the normalizedValue to set
	 */
	public void setNormalizedValue(String normalizedValue) {
		this.normalizedValue = normalizedValue;
	}

	/**
	 * @return the extendedValue
	 */
	public String getExtendedValue() {
		return extendedValue;
	}

	/**
	 * @param extendedValue the extendedValue to set
	 */
	public void setExtendedValue(String extendedValue) {
		this.extendedValue = extendedValue;
	}
	
	
}
